import React, { useEffect, useState } from 'react';
import { getWisata } from '../api';
import { Container, Row, Col, Card } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';

const Home = () => {
    const [wisataList, setWisataList] = useState([]);
    const navigate = useNavigate();

    useEffect(() => {
        getWisata().then(data => setWisataList(data));
    }, []);

    return (
        <Container className="mt-5 pt-5">
            <h2 className="text-center mb-4">Destinasi Wisata</h2>
            <Row>
                {wisataList.map(wisata => (
                    <Col key={wisata.id} md={3} xs={6} className="mb-4">
                        <Card className="shadow-sm" onClick={() => navigate(`/detail/${wisata.id}`)} style={{ cursor: 'pointer' }}>
                            <Card.Img variant="top" src={`/images/${wisata.gambar}`} />
                            <Card.Body className="text-center">
                                <Card.Title>{wisata.nama}</Card.Title>
                            </Card.Body>
                        </Card>
                    </Col>
                ))}
            </Row>
        </Container>
    );
};

export default Home;
